import { NgModule } from "@angular/core";
import { BrowserModule } from "@angular/platform-browser";
import { RouterModule, Routes } from "@angular/router";

import { AppComponent } from "./app.component";
import { HeaderComponent } from "./components/header/header.component";
import { FooterComponent } from "./components/footer/footer.component";
import { AcademyComponent } from "./pages/academy/academy.component";

const routes: Routes = [
  { path: "", redirectTo: "/community", pathMatch: "full" },
  { path: "community", component: AcademyComponent },
  { path: "home", component: AcademyComponent },
  { path: "quotes", component: AcademyComponent },
  { path: "wealth", component: AcademyComponent },
  { path: "portfolio", component: AcademyComponent },
  { path: "profile", component: AcademyComponent },
];

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    AcademyComponent,
  ],
  imports: [BrowserModule, RouterModule.forRoot(routes)],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
